import React, { Component } from "react";

class HelloWorld extends Component {
    constructor() {
        super();
    }
    render() {
        const testList = ["Tis", "is", "a", "list"];
        return (
            <div>
                <p>Hello World!</p>
                <ul className="testList">
                    {testList.map((el, index) => {
                        return <li key={index}>{el}</li>;
                    })}
                </ul>
            </div>
        );
    }
}

export default HelloWorld;

